script: |
  super -f text -I q164.spq | sort > q164.out

inputs:
  - name: q164.spq
    data: |
      SELECT ALL + - cor1.col2 / - ( + cor1.col1 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q164.out
    data: |
      2
      2
      2
      5
      5
      5
      7
      7
      7
